import React from "react";
import TeamMember from "./TeamMember";
function Team(){
    return(
        <div className="row">
       <TeamMember name="Samar"/>
       <TeamMember name="Lama"/>
       <TeamMember name="Nawal"/>
       <TeamMember name="Adam"/>
       <TeamMember name="Samira"/>
       <TeamMember name="Mohamad"/>
       </div>
    );
};
export default Team;
